import React from 'react';
import logo from './logo.svg';
import './App.css';
import Navigation from 'Navigation.js';

class App extends React.Component {



  render() {
    return (

     <browerserRouter>

          <Navigation/>

          <Route exaxt to="/">
            <Home/>
          </Route>

          <Route exaxt to="/signin">
            <SignIn/>
          </Route>

     </browerserRouter>



     );
  }

}

export default App;
